const initialState = {
    name: 'jjoo',
    email: 'hoge@example.com',
    profileUrl:
      'https://avatars1.githubusercontent.com/u/25723193?s=60&u=5f2d871352830fdf1a79ee285e0712044105ca91&v=4'
}

const reducer = (state = initialState, action) => {
    return state
}

export default reducer
